import * as actiontype from "../action/actiontype";

export  const AddTask = (title:any) => {
    console.log("title1231232",title)
    return {
        type: actiontype.ADD_TASK_APP,
        title: title
    }
}
export const GetTask = () => {
    return {
        type: actiontype.GET_TASK_APP
    }
}
